import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Home from './Home';
import Blog from './Blog';
import NewPost from './NewPost';

const App = () => {
  return (

      <div>
        <BrowserRouter>
          <Routes>
            <Route index element={<Home />} />
            <Route path="/Home" element={<Home />} />

          </Routes>

        </BrowserRouter>




      </div>

  );
};

export default App;
